use strict;
use Data::Dumper;


my $data = [];
my $route = {
    'X' => 'M',
    'M' => 'A',
    'A' => 'S',
    'S' => undef
};

my $start = 'X';
my $current = {};
my $matches = 0;

foreach my $line (<DATA>) {
    chomp $line;
    push @$data, [(split //, $line)]
}

for (my $i = 0; $i <= $#$data; $i++) {
    for (my $j = 0; $j <= $#{$data->[$i]}; $j++) {
        if ($data->[$i]->[$j] eq $start) {
            $current = {};
            $current->{$start} = {
                i => $i,
                j => $j
            };
            check_for_next($start, $i, $j);
        }
    }
}

print $matches;

sub check_validity() {
    my $idiff = $current->{'M'}->{i} - $current->{'X'}->{i};
    my $jdiff = $current->{'M'}->{j} - $current->{'X'}->{j};
    return 0 if ($current->{'A'}->{i} - $current->{'M'}->{i} != $idiff);
    return 0 if ($current->{'A'}->{j} - $current->{'M'}->{j} != $jdiff);
    return 0 if ($current->{'S'}->{i} - $current->{'A'}->{i} != $idiff);
    return 0 if ($current->{'S'}->{j} - $current->{'A'}->{j} != $jdiff);
    return 1;
}

sub check_for_next($$$) {
    my $next = shift;
    my $h = shift;
    my $l = shift;

    my $new_next = $route->{$next};
    unless ($new_next) {
        $matches += 1 if check_validity() == 1;
    }

    for (my $i = $h -1; $i <= $h +1; $i++) {
        for (my $j = $l -1; $j <= $l +1; $j++) {
            next if $i == $h && $j == $l;
            if ($i >= 0 && $i <= $#$data && $j >= 0 && $j <= $#{$data->[$i]}) {
                if ($new_next eq $data->[$i]->[$j]) {
                    $current->{$new_next} = {
                        i => $i,
                        j => $j
                    };
                    check_for_next($new_next, $i, $j);
                }
            }
        }
    }
}


